import React from 'react';
import Navbar from './Navbar.js';
import './App.css';
import Product from './ProductCard.js';
import iphone from './ressources/iphonex.png';
import logo from './logo.svg';
import nature from './ressources/nature.jpg';

export default class Menu extends React.Component{
    render(){
        return(
            <div>
                
                <div class="row">
                    <div class="col-12 col-md-4">
                        <Product/>
                    </div>
                    <div class="col-12 col-md-4">
                    <div class="card w-75">
            <div class="card-header">
                <h6 class="d-inline">6000 kr - </h6>
                <small class="d-inline text-muted">Bergen</small>             
            </div>
            <img src={iphone} class="card-img-top img-fluid" alt="alt-image-cap" id="product-photo"/>
            <div class="card-body">
                <p class="card-text ">Pent brukt Iphone X. Kjopt in 2019. Ny pris: 2345 kr. Ma hentes her.</p>
                <button class="btn btn-primary">Send Message</button>
            </div>
        </div>
                    </div>
               
                    
                </div>
            </div>
        )
    }   
}
